import React from 'react';
import Link from "next/link";
import { Form, Icon, Input, Button, Checkbox } from 'antd';

const Loans = () => {
    const [name, setName] = useState('');
    const [phone01, setPhone01] = useState('');
    const [phone02, setPhone02] = useState('');
    const [phone03, setPhone03] = useState('');
    const [term01, setTerm01] = useState(false);
    const [term02, setTerm02] = useState(false);

    const onSubmit = () => {};

    const onChangeName = () => {};

    const onChangePhone01 = () => {};

    const onChangePhone02 = () => {};

    const onChangePhone03 = () => {};

    const onChangeTerm01 = () => {};
    
    const onChangeTerm02 = () => {};
    return (
        <Form layout="inline" onSubmit={onSubmit} style={{textAlign: 'center', backgroundColor: 'silver'}}>
            <Form.Item>
                <label htmlFor="user-name"></label>
                <Input name="user-name" required onChange={onChangeName} style={{width: 100}} placeholder="이름"></Input>
            </Form.Item>
            <Form.Item>
                <label htmlFor="user-phone01"></label>
                <Input name="user-phone01" required onChange={onChangePhone01} style={{width: 100}} placeholder="010" ></Input>
            </Form.Item>
            <Form.Item>
                <label htmlFor="user-phone02"></label>
                <Input name="user-phone02" required onChange={onChangePhone02} style={{width: 100}} placeholder="1234"></Input>
            </Form.Item>
            <Form.Item>
                <label htmlFor="user-phone03"></label>
                <Input name="user-phone03" required onChange={onChangePhone03} style={{width: 100}} placeholder="5678"></Input>
            </Form.Item>
            <div>
                <p style={{marginBottom: -1}}><a href="javascript:window.open('','_blank').close();">[필수] 개인정보 취급방침</a></p>
                <Checkbox name="user-term01" value={term01} onChage={onChangeTerm01}>동의합니다.</Checkbox>
            </div>
            <Form.Item>
                <p style={{marginBottom: -20}}><a href="javascript:window.open('','_blank').close();">[필수] 개인(신용)정보 수집,이용 동의</a></p>
                <Checkbox name="user-term01" value={term02} onChage={onChangeTerm02}>동의합니다.</Checkbox>
            </Form.Item>
            <br />
            <div>
                <Button type="primary" htmlType="submit">빠른 상담신청하기</Button>
            </div>
            <br />
        </Form>
    )
}

export default Loans;
